import { EntrarText, Input, LoginFormContainer } from "./styles";

const LoginForm = () =>{
    return (
        <LoginFormContainer>
            <form>
                <EntrarText>Entrar</EntrarText>
                <InputText type="text" placeholder="Email ou número de celular"/>
                <Input type="text" placeholder="Senha"/>
            </form>
        </LoginFormContainer>
    )
}

export default LoginForm;
